import React from "react";
import './styles.css'
function MyTableRow({product}){
  return (
    <tr>
      <td>{product.name}</td>
      <td>{product.position}</td>
      <td>{product.office}</td>
      <td>{product.age}</td>
      <td>{product.start_date}</td>
      <td>{product.salary}</td>
    </tr>
  )
}

function My ({products}) {
  const rows = [];

  products.forEach(product => {
    rows.push(<MyTableRow product={product}/>)
  })
  return (
    <table className="table">
      <thead>
        <tr>
          <th>Name</th>
          <th>Position</th>
          <th>Office</th>
          <th>Age</th>
          <th>Start date</th>
          <th>Salary</th>
        </tr>
      </thead>
      <tbody>
         {rows}
      </tbody>
    </table>
  )
}

class MyTable extends React.Component {

  render(){
    const {products} = this.props ;
    return (
          <ProductTable products={products}/>
    )
  }
}


export default MyTable;
